(function () {

  'use strict';

  var MQ = MathQuill.noConflict().getInterface(2);

  angular.module('ibw.mathquill.extensions').component('ibMathquillInput', {
    bindings: {
      answer: '<',
      onEdited: '&',
      onFocus: '&'
    },
    controller: MathquillInputController,
    template: '<span class="ib-mathquill-input"></span>'
  });

  function MathquillInputController($element, $timeout, $scope) {
    var _this = this;

    var update = true;
    var $mathquillEl = $element.find('.ib-mathquill-input');
    var mathField = MQ.MathField($mathquillEl.get(0), {
      spaceBehavesLikeTab: true,
      handlers: {

        edit: function edit(mathField) {}

      }
    });

    $mathquillEl.on('focusin', function () {
      update = false;
      _this.onFocus({ mathField: mathField });
      $scope.$apply();
    });

    $mathquillEl.on('focusout', function () {
      var latex = mathField.latex();
      _this.onEdited({ answer: latex });
      $scope.$apply();
      update = true;
    });

    this.$onInit = function () {
      mathField.latex(_this.answer);
    };

    this.$doCheck = function () {
      if ((update || $element.get(0).hasAttribute('readonly')) && mathField.latex() != _this.answer) {
        mathField.latex(_this.answer);
      }
    };
  }
})();

(function () {

  'use strict';

  angular.module('ibw.mathquill.extensions').component('ibMathquillKeyboard', {
    bindings: {
      onKey: '&',
      subjectIds: '<',
      latex: '@'
    },
    controller: MathquillKeyboardController,
    template: '<div class="ib-keyboard"><div ng-repeat="subjectId in $ctrl.subjectIds"><div class="text-center"><span class="category-link" ng-repeat="name in $ctrl.getCategories($ctrl.KEY_CODE_MAP[subjectId.toUpperCase()])" data-name="{{name}}" ng-click="$ctrl.switchCategory(name)" ng-class="{selected:name == $ctrl.currentCategory}">{{name}}</span></div><hr><span class="key" data-is-latex="{{code.isLatex}}" ng-repeat="code in $ctrl.KEY_CODE_MAP[subjectId.toUpperCase()]" ng-click="$ctrl.onKey({value:code.value})" data-symbol="{{code.symbol}}" ng-if="code.isLatex == $ctrl.isLatex() && code.category == $ctrl.currentCategory">{{code.symbol}}</span></div></div>'
  });

  function MathquillKeyboardController(keyboardCode, $element) {
    var _this2 = this;

    this.KEY_CODE_MAP = keyboardCode();

    this.isLatex = function () {
      return _this2.latex == 'true';
    };

    this.getCategories = function (codes) {
      var values = (codes || []).filter(function (code) {
        return code.isLatex == _this2.isLatex();
      });
      var groupResult = _.groupBy(values, 'category');
      return _.keys(groupResult);
    };

    this.switchCategory = function (name) {
      _this2.currentCategory = name;
    };

    this.$doCheck = function (c) {
      var $keys = $element.find('.key');

      if (!_this2.currentCategory) {
        var $categoryLink = $element.find('.category-link').eq(0);
        _this2.currentCategory = $categoryLink.attr('data-name');
      }

      $keys.each(function (index, el) {
        if (angular.element(el).find('.katex').length == 0 && el.dataset.isLatex == 'true') {
          katex.render(el.dataset.symbol, el, { throwOnError: false });
        }
      });
    };
  }
})();

